// RunningList.js

import React, { useEffect, useState } from 'react';
import axiosInstance from '../utils/axiosInstance';

const RunningList = () => {
  const [runnings, setRunnings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchRunnings = async () => {
      setLoading(true);
      try {
        const response = await axiosInstance.get('/api/runnings/get', {
          params: {
            date: "2024-06-26",
          },
        });
        if (Array.isArray(response.data)) {
            setRunnings(response.data);
          } else {
            throw new Error('Returned data is not an array');
          }      } catch (error) {
        console.error('Error fetching runnings:', error);
        setError('러닝 목록을 가져오는 중 오류가 발생했습니다.');
      } finally {
        setLoading(false);
      }
    };

    fetchRunnings();
  }, []);

  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>{error}</p>;
  }

  return (
    <div>
      <h2>Running List for</h2>
      <ul>
        {runnings.map((running) => (
          <li key={running.id}>
            <h3>{running.title}</h3>
            <p>{running.description}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RunningList;
